Animal Practice es una comedia centrada en el doctor George Coleman, un conocido veterinario con una impresionante lista de animales famosos como pacientes. Trabaja en el Crane Animal Hospital, una animada clínica veterinaria de la ciudad de Nueva York en la que, habitualmente, parece que son los pacientes los que dirigen el centro. Pero para su desgracia, George descubre que su ex-novia, Dorothy Crane, acaba de heredar el negocio familiar y ahora es su nueva jefa. Inteligente y ambiciosa, Dorothy pondrá la clínica patas arriba para poner orden y chocará con la forma de trabajar de George, más orientada al bienestar animal.
