Descripcion
¿Qué ocurre cuando un exhuberante e irresponsable soñador que siempre dice sí se muda a vivir con su ultra-responsable hermana pequeña para ayudarle a criar a su hija de cinco años? Pues que la vida de ambos hermanos estará a punto de colapsar cuando decidan convivir en el mismo techo. De los productores ejecutivos Dana Fox (Algo pasa en Las Vegas) y Jake Kasdan (New Girl), Ben and Kate es una hilarante comedia que muestra la vida de estos dos hermanos que juntos, y con la ayuda de sus amigos, están a punto de abandonar la comodidad de sus vidas y entrar, de una vez por todas, en la vida real.
