De Matt Olmstead y Nick Santora, productores de la exitosa Prison Break, llega Breakout Kings, una nueva serie de acción que muestra la sociedad poco convencional que se establece entre dos U.S. Marshals y un grupo de convictos, que trabajan juntos para capturar a peligrosos fugitivos. Después de 72 horas, las posibilidades de encontrar a un prisionero que se ha escapado caen a menos de un cinco por ciento. Sabiendo que hay pocas cosas más peligrosas que un convicto a la fuga, y cansados de los métodos de las fuerzas de la ley, dos veteranos oficiales de los U.S. Marshals deciden rechazar los protocolos de actuación y usar ex-fugitivos para capturar a los que se han dado a la fuga.
