Zero Hour, producida por Lorenzo DiBonaventura (Transformers), Paul Scheuring (Prison Break) y Dan McDermott (Escudo humano), es un thriller de acción que nos introduce en una emocionante aventura por todo el mundo, para revelar una de las mayores conspiraciones de la historia de la humanidad, una que poderosas fuerzas han logrado mantener oculta durante demasiado tiempo. Y todo gira en torno a Hank Galliston, un editor de revistas que ha pasado toda su vida rodeado de mitos y leyendas, sólo para acabar inmerso en un verdadero misterio tras la sorprendente desaparición de su esposa. Para encontrarla deberá desentrañar una peligrosa conspiración que rodea a los doce apóstoles, que le llevará a cuestionarse incluso su propia identidad.
